import React from 'react';
import './Skills.css';
import skills from './skillsData';

const Skills = () => {
  return (
    <section className="section skills bg-grey" id="skills">
      <div className="section-center">
        <div className="section-title skills-title">
          <h2
            className="animate"
            data-animate="tracking-in-expand 1s cubic-bezier(0.215, 0.610, 0.355, 1.000) both"
          >
            Skills
          </h2>
          <div className="underline" />
        </div>

        <div className="skills-center">
          {skills.map((skill) => (
            <figure
              key={skill.id}
              className="skills-icon animate"
              data-animate="slideInLeft 1s"
              tabIndex={0}
              role="img"
              aria-label={skill.ariaLabel}
            >
              {skill.svg}
              <p>{skill.name}</p>
            </figure>
          ))}
        </div>
      </div>
    </section>
  );
};
export default Skills;
